        "rek_file_downloads": 0,
        "rek_citation": "<a class=\"author_id_link\" title=\"Browse by Author ID for Overgaard, Nana H.\" href=\"\/list\/author_id\/1419754\/\">Overgaard, Nana H.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Cruz, Jazmina L.\" href=\"\/list\/author_id\/2009692\/\">Cruz, Jazmina L.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Bridge, Jennifer A.\" href=\"\/list\/author_id\/90030\/\">Bridge, Jennifer A.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Nel, Hendrik J.\" href=\"\/list\/author_id\/90185\/\">Nel, Hendrik J.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Frazer, Ian H.\" href=\"\/list\/author_id\/410\/\">Frazer, Ian H.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for La Gruta, Nicole L.\" href=\"\/list\/author\/La+Gruta%2C+Nicole+L.\/\">La Gruta, Nicole L.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Blumenthal, Antje\" href=\"\/list\/author_id\/82335\/\">Blumenthal, Antje<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Steptoe, Raymond J.\" href=\"\/list\/author_id\/2965\/\">Steptoe, Raymond J.<\/a> and <a class=\"author_id_link\" title=\"Browse by Author ID for Wells, James W.\" href=\"\/list\/author_id\/88933\/\">Wells, James W.<\/a> (<span class=\"citation_date\">2017<\/span>) <a class=\"citation_title\" title=\"Click to view Journal Article: CD4+CD8&beta;+ double-positive T cells in skin-draining lymph nodes respond to inflammatory signals from the skin\" href=\"\/view\/UQ:654776\">CD4+CD8\u03b2+ double-positive T cells in skin-draining lymph nodes respond to inflammatory signals from the skin<\/a>. <i><span class=\"citation_journal_name\">Journal of Leukocyte Biology<\/span><\/i>, <i><\/i>  . doi:<span class=\"citation_doi\">10.1189\/jlb.1AB0217-065R<\/span>",
        "rek_genre": "Journal Article",
        "rek_genre_type": null,
        "rek_formatted_title": null,
        "rek_formatted_abstract": "CD4+CD8+ double-positive (DP), mature, peripheral T cells are readily detectable in a variety of species and tissues. Despite a common association with autoimmune and malignant skin disorders, however, little is understood about their role or function. Herein, we show that DP T cells are readily detectable in the blood, spleen, and peripheral lymph nodes of na&iuml;ve C57BL\/6 mice. DP T cells were also present in J&alpha;18&minus;\/&minus; and CD1d&minus;\/&minus; mice, indicating that these cells are not NK-T cells. After skin administration of CASAC adjuvant, but not Quil A adjuvant, both total DP T cells and skin-infiltrating DP T cells increased in number. We explored the possibility that DP T cells could represent aggregates between CD4+ and CD8+ single-positive T cells and found strong evidence that a large proportion of apparent DP T cells were indeed aggregates. However, the existence of true CD4+CD8+ DP T cells was confirmed by Amnis ImageStream (Millipore Sigma, Billerica, MA, USA) imaging. Multiple rounds of FACS sorting separated true DP cells from aggregates and indicated that conventional analyses may lead to &sim;10-fold overestimation of DP T cell numbers. The high degree of aggregate contamination and overestimation of DP abundance using conventional analysis techniques may explain discrepancies reported in the literature for DP T cell origin, phenotype, and function.",
